import Card from './Card';

export default function FeedbackItem({data,text,id,rating}) {
  console.log(data,'data')
  return (
    <>
       <Card>
        <p className='rating'>{text}</p>
        <p className='rating'>{id}</p>
        <p className='rating'>{rating} </p>
   </Card>
    </>

  )
}
